  passwordHash: string,
  email: string,
  role: Role,
  createdAt: string
): Promise<void> => {
  await apiClient.post('/users/newUser', {
    username,
    passwordHash,
    email,
    role,
    createdAt,
  });
};

export const saveToken = (token: string): void => {
  localStorage.setItem(tokenKey, token);
};

export const clearToken = (): void => {
  localStorage.removeItem(tokenKey);
};
